import React from 'react';

function LocationList({ locations, onDelete }) {
  return (
    <div>
      <h2>Kayıtlı Yerler</h2>
      {locations.length === 0 && <p>Henüz yer eklenmedi.</p>}
      <ul>
        {locations.map((loc) => (
          <li key={loc.id}>
            <strong>{loc.name}</strong> — {loc.description}
            <button onClick={() => onDelete(loc.id)}>Sil</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default LocationList;
